import React,{useState} from "react";

const App = ()=>{
    const [data,setData] = useState({
        firstName : '',
        lastName : '',
        email : ''
    });

    const inputEvent = (event)=>{
        let value = event.target.value;
        let name = event.target.name;
        console.log(value);
    }

    const onFormSub = (event)=>{
        event.preventDefault();
        alert('hello');
    }

    return (
        <>
            <form onSubmit={onFormSub}>
                <div>
                    <h1>Hello </h1>
                    <input type="text" placeholder="Enter Your First Name" name={data.firstName} onChange={inputEvent} />
                    <br/>
                    <br/>
                    <input type="text" placeholder="Enter Your Last Name" name={data.lastName} onChange={inputEvent} />
                    <br/>
                    <br/>
                    <input type="text" placeholder="Enter Your Email" name={data.email} onChange={inputEvent} />
                    <br/>
                    <br/>
                    <button>Submit</button>
                </div>
            </form>
        </>
    )
}

export default App;
